def cryptcycle(mode, pwd, string):
    key = generate(num_of_atom=1, seed=pwd, min_atom_len=32, max_atom_len=32)
    key = key.get_key().encode("utf-8")
    key = base64.urlsafe_b64encode(key)
    f = Fernet(bytes(key))

    if mode in ("e", "E"):
        string = str(string)
        string = string.encode("utf-8")
        encstring = f.encrypt(string)
        encstring = encstring.decode("utf-8")
        return encstring
    if mode in ("d", "D"):
        string = string.encode("utf-8")
        decstring = f.decrypt(string)
        decstring = decstring.decode("utf-8")
        return decstring


def file2cycle(mode, pwd, **string):
    if mode == "r":
        file = open(".secure_2.txt", "r")
        conts = file.read()
        file.close()
        if len(conts) != 0:
            conts = cryptcycle("d", pwd, conts)
        return conts
    if mode == "w":
        string = cryptcycle("e", pwd, string)
        file = open(".secure_2.txt", "w")
        file.write(string)
        file.close()

